import React from 'react';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { Content, Footer, Panel, Grid, Row, Col } from 'rsuite';
import Graph from './GraphPage/Graph';
import MaterialsPage from './MaterialPage/MaterialsPage';
import SurfacePage from './SurfacePage/SurfacePage';
import GrobnerPage from './GrobnerPage/GrobnerPage';
import 'rsuite/dist/styles/rsuite-default.css';
import { Box, Tabs } from '@mui/material';
import './styles.css';
import Shader from './CustomComponents/Shader';
import { fs } from './ShaderStuff/fragmentShaderMovable';
import newId from './uniqueIdHook';

const theme = createTheme({
  palette: {
    main: '#0076DF',
    primitive: '#609dff',
    boolean: '#ff5858',
    deform: '#3ec224',
    transform: '#ffbb62',
  },
});

function MainContent() {
  return (
    <>
      <Grid fluid>
        <Row>
          <Col xs={6}>
            <Shader
              style={{ height: '100vh' }}
              shader={fs('box(p, vec3(1.0))')}
              uniforms={{ color: { type: '3fv', value: [1.0, 1.0, 0.0] } }}
            />
          </Col>
          <Col xs={1}>
            <div style={{ borderRight: '2px solid grey', height: '100vh' }} />
          </Col>
          <Col xs={17}>
            {/* <ContextMenu/> */}

            <Graph />
          </Col>
        </Row>
      </Grid>
    </>
  );
}

const layoutStyles = {
  display: 'flex',
  flexDirection: 'column',
  height: '100vh',
};

const getVisibilityStyle = (hiddenCondition) => {
  if (hiddenCondition) {
    return {
      visibility: 'hidden',
      height: 0,
    };
  }
  return {
    visibility: 'visible',
    height: 'inherit',
  };
};

export default function App() {
  const [tabVal, setTabVal] = React.useState(1);
  const tabs = [<MainContent/>, <GrobnerPage />, <SurfacePage />];

  return (
    <div style={layoutStyles}>
      <Box sx={{ width: '100%', typography: 'body1' }}>
        <TabContext value={tabVal}>
          <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
            <TabList
              onChange={(e, v) => setTabVal(v)}
              aria-label="lab API tabs example"
            >
              <Tab label="Item One" value={0} />
              <Tab label="Item Two" value={1} />
              <Tab label="Item Three" value={2} />
            </TabList>
          </Box>
          {tabs.map(function (tabComponent, idx) {
            return (
              <TabPanel value={idx}>
                <div
                  key={newId('floatInputContainer_')}
                  style={getVisibilityStyle(idx !== tabVal)}
                >
                  {tabComponent}
                </div>
              </TabPanel>
            );
          })}
          
        </TabContext>
      </Box>

      <ThemeProvider theme={theme}>
        <Box>
          <Box>
            <Tabs value={tabVal} onChange={(e, v) => setTabVal(v)}>
              <Tab label="Graph" />
              <Tab label="Groebner" />
              <Tab label="Surfaces" />
            </Tabs>
          </Box>
          {tabVal}
          <Box sx={{ padding: 2 }}>
            {tabs.map(function (tabComponent, idx) {
              return (
                <div>
                  {idx !== tabVal}
                  <div
                    key={newId('floatInputContainer_')}
                    style={getVisibilityStyle(idx !== tabVal)}
                  >
                    {tabComponent}
                  </div>
                </div>
              );
            })}
          </Box>
        </Box>

        <Content style={{ flexGrow: 1 }}></Content>
        <Footer>
          <Panel bordered>
            <p>Daniel Zufr√≠ Quesada</p>
          </Panel>
        </Footer>
      </ThemeProvider>
    </div>
  );
}
